/**
 * Created by Lenovo on 2019/8/10.
 */
import React from 'react';
import './register.css';
import {Title,List,Input} from '../../share';
import {getData, goNext} from '../../utils';
import verifyCode from '../../images/register/verify-code.png';
const Item = List.Item;
export default class Register extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            name: '',
            phone: '',
            verify:"",
            password:'',
            confirmPassword:''
        }
    }
    goBack(){
        goNext(this,'app',3)
    }
    change(state){
        this.setState(state)
    }
    renderRight(){
        return(
            <div><img src={verifyCode} alt="" className="cm-img-small-icon"/><span className="cm-c-main cm-ml-10">获取验证码</span></div>
        )
    }
    render() {
        return<div>
            <Title  onLeftClick={()=>this.goBack()} title="注册"/>
            <div className="cm-mlr-15">
               <List>
                   <Input
                       label="昵称"
                       placeholder="请输入昵称"
                       value={this.state.name}
                       onChange={(val)=>this.change({name:val})}
                   />
               </List>
                <List>
                    <Input
                        label="手机号码"
                        placeholder="请输入手机号码"
                        value={this.state.phone}
                        onChange={(val)=>this.change({phone:val})}
                    />
                </List>
                <List>
                    <Input
                        label="验证码"
                        placeholder="请输入验证码"
                        value={this.state.verify}
                        onChange={(val)=>this.change({verify:val})}
                        renderRight = {()=>this.renderRight()}
                    />
                </List>
                <List>
                    <Input
                        label="密码"
                        type="password"
                        placeholder="请输入密码"
                        value={this.state.password}
                        onChange={(val)=>this.change({password:val})}
                    />
                </List>
                <List>
                    <Input
                        label="确认密码"
                        type="password"
                        placeholder="请输入确认密码"
                        value={this.state.confirmPassword}
                        onChange={(val)=>this.change({confirmPassword:val})}
                    />
                </List>
                <div className="cm-tx-c">
                    <span className="cm-btn-small login-mt-40">注册</span>
                </div>
                <div className="cm-tx-r login-operate">
                   已有账户？登录
                </div>
            </div>
        </div>
    }
}
